import React from "react";
import Header from "../Header";
import './Apartament.css'
import CheckInSection from '../CheckInSection'
import HotelRoom from "./HotelRoom";
import room1 from '../images/room-1.jpg'
import room2 from '../images/room2.jpg'
import room3 from '../images/room7.jpg'
import room4 from '../images/room14.jpg'
import { useState } from "react";
import { Link, useParams } from "react-router-dom";

export default function Apartament(){
    const[state,setState]=useState()
    const params=useParams();
    console.log(params);

    return(
        <>
        <div className="book-background">
        <Header background2={`background2`} background={`back2`} backApart={`backapart`} heading='Our Apartament'/>
        <CheckInSection
         HotelRoom={<Link to={'/roomdescription/junior'}><HotelRoom suite='Junior Suite' size='260'bed='2' price='350' src={room1} /></Link>}
         HotelRoom1={<Link to={'/roomdescription/standart'}><HotelRoom suite='Standart Room' size='230'bed='1' price='250' src={room2} /></Link>}
         HotelRoom2={<Link to={'/roomdescription/superior'}><HotelRoom suite='Superior Room' size='270'bed='1' price='550' src={room3} /></Link>}
         HotelRoom3={<Link to={'/roomdescription/junior'}><HotelRoom suite='Standart Room' size='280'bed='2' price='250' src={room4} /></Link>}
         className={`formmaindiv-apartm`}
         />
        </div>
        </>
    )
}
